`;

const Wrapper = styled.div`
  display: block;
  border: 10px solid red;
  height: 800px;
  width: 800px;
`;

const Map = styled.div`
  width: 500px;
  height: 500px;
  background-color: blue;
`;

const WrapperBack = () => {
  return (
    <Wrapper>
    <TransformWrapper
      defaultScale={0.1}
      defaultPositionX={0}
      defaultPositionY={0}
      minScale={0.2}
      maxScale={5}
    >
      {({ zoomIn, zoomOut, resetTransform, positionX, positionY, ...rest }) => (
        <React.Fragment>
          <TransformComponent>
            <Container>
            </Container>
          </TransformComponent>
        </React.Fragment>
      )}
    </TransformWrapper>

    // </Wrapper>
  );
};

export default WrapperBack;

